import React from "react";

const NewTodo = ({inputVal}) => {


  return (
    <>
      <div className="newtodo-container shadow">
        <h1 className="newtodo-container__title">New Todo</h1>
        <div className='input-group '>
          <input type='text' className='form-control me-3' />
          <button className="newtodo-container__btn">Add Item</button>
        </div>
      </div>
    </>
  );
};

export default NewTodo;
